CREATE DEFINER=`root`@`localhost` PROCEDURE `filtro_data`(IN `p_fecha_inicio` DATE, IN `p_fecha_fin` DATE, IN `p_caso_situacional` VARCHAR(255), IN `p_usu_id` INT, IN `p_deli_delito` VARCHAR(255))
BEGIN
	
   IF p_caso_situacional = '' THEN
        SET p_caso_situacional = NULL;
    END IF;
    
    IF p_usu_id = '' THEN
        SET p_usu_id = NULL;
    END IF;
    
    IF p_deli_delito = '' THEN
        SET p_deli_delito = NULL;
    END IF;


    SELECT 
        u.usu_name, 
        u.usu_lastname, 
        c.caso_id,   
        c.caso_date,
        c.caso_hour,
        c.ubi_id,
        c.caso_situacional,
        c.caso_medidas,
        c.deli_delito,
        c.deli_subdelito,
        c.deli_espdelito,
        c.deli_detalle,
        c.caso_date_new,
        c.caso_date_edit,
        c.caso_date_delete,
        c.caso_status,
        c.usu_id,
        ub.ubi_id,
        ub.ubi_district
    FROM 
        tm_casos c
    INNER JOIN 
        tm_usuarios u ON c.usu_id = u.usu_id
	   INNER JOIN 
        tm_ubigeo ub ON c.ubi_id = ub.ubi_id
    WHERE 
        c.caso_date BETWEEN p_fecha_inicio AND p_fecha_fin
        AND (p_caso_situacional IS NULL OR c.caso_situacional = p_caso_situacional)
        AND (p_usu_id IS NULL OR c.usu_id = p_usu_id)
        AND (p_deli_delito IS NULL OR c.deli_delito = p_deli_delito);
END ;;
